import React from "react";

// Each item has a photo file name and a corresponding external link
const photos = [
  { file: "OIP.jpg", link: "https://himtrek.co.in/activity/triund-trek/" },
  { file: "OIP (1).jpg", link: "https://www.holidify.com/places/mcleodganj/bhagsu-falls-sightseeing-2817.html" },
  { file: "OIP (2).jpg", link: "https://example.com/place3" },
  { file: "OIP (3).jpg", link: "https://example.com/place4" },
  { file: "OIP (4).jpg", link: "https://example.com/place5" },
  //{ file: "OIP (5).jpg", link: "https://example.com/place6" },
  //{ file: "OIP (6).jpg", link: "https://example.com/place7" }
];

const Photos = () => (
  <div className="w3-padding-64 w3-content" id="photos">
    <h2 className="w3-text-light-grey">My Photos of Visiting Places</h2>
    <hr style={{ width: "200px" }} className="w3-opacity" />
    <div className="w3-row-padding" style={{ margin: "0 -16px" }}>
      <div className="w3-half">
        {photos.slice(0, 3).map(({ file, link }, idx) => (
          <a
            key={idx}
            href={link}
            target="_blank"
            rel="noopener noreferrer"
          >
            <img
              src={`/images/${file}`}
              style={{ width: "100%", marginBottom: "16px" }}
              alt={`place ${idx + 1}`}
            />
          </a>
        ))}
      </div>
      <div className="w3-half">
        {photos.slice(3).map(({ file, link }, idx) => (
          <a
            key={idx + 3}
            href={link}
            target="_blank"
            rel="noopener noreferrer"
          >
            <img
              src={`/images/${file}`}
              style={{ width: "100%", marginBottom: "16px" }}
              alt={`place ${idx + 4}`}
            />
          </a>
        ))}
      </div>
    </div>
  </div>
);

export default Photos;






